import React from 'react'
import './App.css'
import Header from './Grids/Header'
import Navbar from './Grids/Navbar'
import Profile from './Grids/Profile'

function App() {
  return (
    <div className="App">
        <div><Header />
        <div>
          <Navbar />
          <Profile />
        </div>
      </div>
    </div>
  );
}

export default App;
